import React from 'react';

const Homepage = () => {
    return (
        <div>
            <h1>TEMPAT PENGEMBANGAN KARIER TERBAIK UNTUKMU!</h1>
            <h3>Buat keputusan terbaik untuk kariermu dan bangun karier impianmu</h3>
        </div>
    );
}

export default Homepage;
